import React from 'react'

export default function BacktoShopButton() {
    return (
        <Link to="/products">
            <button className="btn btn-outline-danger text-uppercase mb-3 px-5" 
            type="button"
            // onClick={() => clearCart()}
            >
               continue shopping
            </button>
        </Link>
    )
}
